import React, { useState } from 'react';
import './App.css';
import hic from './img/hic.jpg';
import styled from 'styled-components'
import {Link, useHistory} from "react-router-dom";
import Detail from './Detail.js';
import moonlight from './img/moonlight.png';

function Illustration(props) {
  const history = useHistory('');
  const [url, setUrl] = useState('');
  const [title, setTitle] = useState('moonlight');

function handleClick(event){
  event.preventDefault();
    history.push(`/detail/title=${props.title}`);
  }

  return (
    <div style={{
      margin:"0 auto",
      }}
      onClick={handleClick}>
     <img style={{  
        display: "flex",
        justifyContent: "center",
        alignItems: "flex-start",
        alignContent:"flex-start",
        padding: "20px 0",
        width: "350px",
        mixBlendMode: "multiply",
        float:"left"
        }}
        src={props.url}
        onClick={(e)=>setUrl(e.src)}/>
        <p onChange={(e)=>setTitle(e.target.value)}>{props.title}</p>
  </div>


  );
}

export default Illustration;
